css:
@-moz-document url-prefix('https://tools.ietf.org/html') {
    #legend, .docinfo, body {
        background-color: #333;
        color: #eee;
    }

    a {
        color: #55f;
        text-decoration: none;
    }

    .docinfo {
        background-color: #222;
        font-weight: bold;
    }

    .selflink {
        color: white !important;
    }
}
